import React, { useState } from "react";
import { AppBar, Typography, ThemeProvider, CssBaseline, createTheme } from "@mui/material";
import Create from "./Create";
import Room from "./Room";
import "../css/Main.scss";
import ReactGA from "react-ga4";
import { BrowserRouter, Routes, Route } from "react-router-dom"; // v6

const theme = createTheme({
  typography: {
    fontFamily: ["Yeon Sung", "Sans Serif"].join(","),
    h3: {
      letterSpacing: "2px",
    },
  },
  palette: {
    primary: {
      main: "#2994ff",
    },
    background: {
      default: "#c2e0ff",
    },
  },
});

const key = process.env.REACT_APP_ANALYTICS_KEY;
if (key) {
  ReactGA.initialize(key);
}

const Main = () => {
  const [username, setUsername] = useState("");

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />

      <AppBar position="static" className="menu">
        <Typography variant="h5">
          <a href="/">Hangmanonline.io</a>
        </Typography>
      </AppBar>

      <div className="container">
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Create setUser={setUsername} user={username} />} />
            <Route path="/:roomID" element={<Room username={username} />} />
          </Routes>
        </BrowserRouter>
      </div>
    </ThemeProvider>
  );
};

export default Main;
